import './App.css';
import React from 'react'
//eslint-disable-next-line
import {Routes, Route, BrowserRouter} from 'react-router-dom';
import IndexPage from '../src/page/IndexPage';
import RegSong from '../src/page/RegSong';
import ModeSel from '../src/page/ModeSel';
import GameBoard from '../src/page/GameBoard';


function App() {
  return (
    <BrowserRouter>
      <Route path="/" element={<IndexPage></IndexPage>}/>
      <Route path="/board/regSong" element={<RegSong></RegSong>}/>
      <Route path="/board/modeSel" element={<ModeSel></ModeSel>}/>
      <Route path="/board/multiGameBoard" element={<GameBoard></GameBoard>}/>
    </BrowserRouter>
  );
}

export default App;
